●うすめずそのまま使える、かんたん便利な、すばやい効きめの液体肥料です。鉢植えやプランター植えの草花、野菜、ハーブ、観葉植物等におすすめです。
<br>●開花や結実を促進するリン酸分が多い肥料です。（チッ素：リン酸：カリ＝0.1：0.2：0.1）
