花ごころ　IBのチカラ　グリーンそだちEX　５００ｇ<br><br>
花にも野菜にも観葉にも効果抜群！！<br>
室内でも安心、無臭で清潔な肥料<br>
ゆっくり長く効く緩効性肥料です。<br>
花付きをよくするリン酸成分など、３つの成分をバランスよく配合された肥料です。<br>
野菜から観葉植物など、ほとんどの植物にお使いいただけます。<!--/* かごボタンの真上にバナー */
